import './App.css';
import Header from './components/Header';
import PinderCards from './components/PinderCards';
import SwipeButtons from './components/SwipeButtons';


function App() {
  return (
    <div className="App">
      {/** App Header */}
      <Header />
      {/** App Cards */}
      <PinderCards/>
      {/** App Swipe buttons */}
      <SwipeButtons/>
    </div>
  );
}

export default App;
